import "./App.css";
import { useState } from "react";
import { Route, Routes } from "react-router-dom";

function App() {
  const [showSearchPage, setShowSearchpage] = useState(false);

  return (
    <div className="app">
      <Routes>
        <Route 
         exact
         path="/"
         element={<></>}
         />
         <Route
          exact
          path="/search"
          element={<></>}
         />
      </Routes>
    </div>
  );
}

export default App;
